import React from 'react';
import Layout from '../components/Layout.js';
import HomeBody from '../components/Homebody.js';
import Footer from '../components/Footer.js';

export default class IndexPage extends React.Component {
render() {
  return (
          <div>
            <Layout />
              <HomeBody />
            <Footer />
          </div>
    );
  }
}
